function WeakauraImporter:GetWeakAuras(key)
    if key == "raid" then
        key = "raid_manaforge" -- current raid
    end

    return self.WeakAuraImports[key]
end

function WeakauraImporter:OnEnable()
    if not WeakAuras then
        self:Print("WeakAuras not found! Please install WeakAuras to use this addon.")
        return
    end

    self:RegisterChatCommand("apimport", function(input)
        if not input or input:trim() == "" then
            self:Print("Usage: /apimport <raid, anchors, base>")
            return
        end

        local key = input:trim():lower()
        local data = self:GetWeakAuras(key)

        if not data then
            self:Print("No WeakAura data found for key: " .. key .. ". Valid keys are: raid, anchors, base.")
            return
        end

        _G["WeakAuras"].Import(data)
    end)
end